import { Component } from "react";
import {} from "./style.css"

export class Panel extends Component {
    state = {
        user: "logged"
    }

    render() {
        return (
            <>
            <div className="position">
            <a>Start game</a>
            <a>Tutorial</a>
            <logo className="logo font">TIC-TAC-TOE9x9</logo>
            <a>Log in</a>
            <a>Log out</a>
            </div>
            </>
        )
    }
}
